BEGIN TRANSACTION;
DROP TABLE IF EXISTS "TBL_DIO";
CREATE TABLE "TBL_DIO" (
	"NO"	INT NOT NULL,
	"DIRECTION"	TEXT NOT NULL,
	"IDX"	INT NOT NULL,
	"ADDRESS"	INTEGER NOT NULL,
	"PART_NO"	INT NOT NULL,
	"LABEL"	INTEGER NOT NULL,
	"NAME"	TEXT NOT NULL,
	"CONTACT"	TEXT NOT NULL,
	"DIO_TYPE"	TEXT NOT NULL DEFAULT 'SOFTSERVO',
	"GUI_LOC_X"	INTEGER DEFAULT -1,
	"GUI_LOC_Y"	INTEGER DEFAULT -1
);
COMMIT;
